import { Component } from '@angular/core';

@Component({
  selector: 'app-test',
  template: `
    <div>
      <h1>Welcome {{name}}<h1>
      <h2>{{greet}}<h2>
    </div>
  `,
  styleUrls: ['./test.component.css']
})
export class TestComponent {
  public name : any = 'karthick';
  age : number= 18;

  greet(){
    return "hi"+ this.name+ 'with age'+this.age;
  }


}
